  [],\n\t\"revision_timestamp\": \"2016-07-27T22:43:32.773640\",\n\t\"name\": \"report-of-analytical-results-from-fish-and-salvaged-eaglets\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These results summarized in this report
  are for fish that were collected from Crab Orchard Lake and are cross-checks with
  Illinois EPA. This memorandum report also contains the results of chemistry from
  two eaglets that were salvaged as the result of them apparently falling from the
  nest located at Grassy Bay (a bay of Crab Orchard Lake) . Fifty percent of the fish
  studied meet or exceed the FDA action level and some type of consumption advisory
  is probably warranted on Crab Orchard Lake. High PCB concentrations were predicted
  in the eagles nesting near Crab Orchard Lake, but the measured PCB concentrations
  were not much different than we see in inland populations that are supposedly removed
  from sources of high concentrations of PCBs. This suggests that the adult eagles
  did not feed fish from Crab Orchard Lake to their young during this breeding season.\",\n\t\"license_title\":
